import { useState, useEffect } from "react";

const Clima = ({ region }) => {
  const [dataResponse, setDataResponse] = useState("");
  console.log(region);
  useEffect(() => {
    fetch(
      `api.openweathermap.org/data/2.5/weather?lat=-33.1236&lon=-64.3492&appid=12f79219938e1bf1c3a59af0fca96d62`,
      {
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json",
          Authorization: "Client-ID 12f79219938e1bf1c3a59af0fca96d62",
        }
      }
    )
      .then((response) => response.json())
      .then((data) => {
        const obj = {
          weather: data[1].description,
        };
        setDataResponse([...dataResponse, obj]);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [region]);
  console.log(dataResponse);

  return <div>Hola</div>;
};

export default Clima;
